  [],\n\t\"revision_timestamp\": \"2015-05-06T21:35:54.853065\",\n\t\"name\": \"data-mining-for-ivhm-using-sparse-binary-ensembles-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In response to NASA SBIR topic A1.05, \"Data
  Mining for Integrated Vehicle Health Management\", Michigan Aerospace Corporation
  (MAC) asserts that our unique SPADE (Sparse Processing Applied to Data Exploitation)
  technology meets a significant fraction of the stated criteria and has functionality
  that enables it to handle many applications within the aircraft lifecycle. SPADE
  distills input data into highly quantized features and uses MAC's novel techniques
  for constructing Ensembles of Decision Trees to develop extremely accurate diagnostic/prognostic
  models for classification, regression, clustering, anomaly detection and semi-supervised
  learning tasks. These techniques are currently being employed to do Threat Assessment
  for satellites in conjunction with researchers at the Air Force Research Lab. Significant
  advantages to this approach include: 1) completely data driven; 2) training and
  evaluation are faster than conventional methods; 3) operates effectively on huge
  datasets (&gt; billion samples X &gt; million features), 4) proven to be as accurate
  as state-of-the-art techniques in many significant real-world applications.  The
  specific goals for Phase 1 will be to work with domain experts at NASA and with
  our partners Boeing, SpaceX and GMV Space Systems to delineate a subset of problems
  that are particularly well-suited to this approach and to determine requirements
  for deploying algorithms on platforms of opportunity. \",\n\t\"license_title\":
